import VueRouter from 'vue-router'
import SortPage from '../views/Sort.vue'
import HomePage from '../components/HomePage.vue'
export default new VueRouter({
    routes:[
        {
           path:'/',
           component:[HomePage],
           children:[
            {
                path:'sort',
                name:'sort',
                component:[HomePage]
            }
           ]
        }
    ]
})
